import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";
class Landing extends Component {
  render() {
    return (
      <div style={{ width: "100%", margin: "auto" }}>
        <Grid className="landing-grid">
          <Cell col={12}>
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.shareicon.net%2Fwork-avatar-man-business-male-office-costume-106427&psig=AOvVaw2FTGA_OEFC3H8yls2OfkZe&ust=1606241208318000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJCLmIGhme0CFQAAAAAdAAAAABAD" />
          </Cell>
        </Grid>
      </div>
    );
  }
}
export default Landing;
